def acumular(pais,confirmados,muertos,recuperados):
    encontrado = False
    i = 0;
    #print(len(datos))
    while i < len(datos):
        #print(datos[i])
        #print(datos[i]["pais"])
        if pais == datos[i]["pais"]:
            encontrado = True
            datos[i]["confirmados"] += confirmados
            datos[i]["muertos"] += muertos
            datos[i]["recuperados"] += recuperados
            break
        i+=1

    if encontrado == False:
        dato = {"pais": pais, 
                "confirmados": confirmados, 
                "muertos": muertos,
                "recuperados": recuperados}
        datos.append(dato)

